import React from 'react'

function Alert() {
    return (
        <div>
            <div class="alert alert-primary" role="alert">
                A simple primary alert with <a href="#" class="alert-link">an example link</a>. Give it a click if you like.
            </div>
        </div>
    )
}

export default Alert
